评论内容:
@danielcardozo_jr Fan Zhendong é uma estrela, está iniciando uma nova fase na na Europa, a convite de um time alemão, depois de ter saído do circuito internacional precocemente por problemas com as regras da ITTF.

Ele agrega muito, traz visibilidade, mídia e dinheiro onde quer que pise. Fazer um show durante a comemoração, considerando que ele está em uma nova fase, agregando, se adaptando em um país diferente, se restabelecendo de um momento atual ruim ou decepcionante com o órgão máximo do TM, não é ser um bom anfitrião, desrespeitoso e sem empatia.

Exagero, considerando esse contexto. Hugo não faria o mesmo. Apertaria a mão, mostrando respeito pela lenda chinesa e desejando boa sorte.

评论翻译:
@danielcardozo_jr 樊振东是颗明星，应德国一支球队的邀请，开启了在欧洲的新阶段，此前他因ITTF的规则问题过早地离开了国际赛场。

他走到哪里都能带来很多价值，带来曝光、媒体和金钱。考虑到他在新阶段，增添价值、在一个不同国家适应、从与桌球最高机构的一个糟糕或令人失望的时刻中恢复过来，在庆祝活动中做秀，并不是待客之道，是不尊重人且缺乏同情心。

考虑到这个背景，这种说法有些夸大。Hugo不会这样做。他会握手，向这位中国传奇人物表示尊重并祝愿他好运。
